window.bookSummaryJSON = "<b>❄️</b><b> FROSTBOUND ALPHA </b><b>❄️</b><br><br><b><i>A mate marked in blood. A power she never asked for. A bond that could destroy them both…</i></b><br><br>I ran to Alaska to disappear.<br>To forget the bruises, the nightmares, the past that chewed me up and spat me out.<br>But fate doesn’t care that I’m broken.<br>It doesn’t care that I’m running.<br>It sent him.<br><b>Bastian Valen—Alpha</b>, ruthless, carved from ice.<br>His eyes see everything I hide, and his touch burns through every wall I’ve built.<br>But there’s something inside me, something ancient and dangerous, and when I’m near him… it wakes.<br><br>They say I’m a Finder.<br>A rare breed, meant to balance the supernatural world—<br>or burn it to the ground.<br>He thinks he can control me.<br>He’s wrong.<br>I didn’t come here to find love.<br>I came here to survive.<br>But the Hollow is rising, enemies stalk us in the shadows, and this bond between us?<br><br>It might be the beginning of war.<br><b>I’m not his mate.<br>I’m his reckoning.</b>"; 
